from heapq import *


class Solution:
    def shortestDistance(self, maze, start, destination):
        """
        :type maze: List[List[int]]
        :type start: List[int]
        :type destination: List[int]
        :rtype: int
        """
        dirs = [[-1, 0], [1, 0], [0, -1], [0, 1]]
        queue = []
        start = tuple(start)
        visited = set()
        heappush(queue, (0, start))

        def bfs(cur, dir):
            tmp = 0
            curX, curY = cur[0], cur[1]
            while 0 <= curX + dir[0] < len(maze) and 0 <= curY + dir[1] < len(maze[0]) and maze[curX + dir[0]][
                curY + dir[1]] != 1:
                curX += dir[0]
                curY += dir[1]
                tmp += 1
            return tmp, (curX, curY)

        while queue:
            dis, node = heappop(queue)
            if node in visited:
                continue
            visited.add(node)
            if node == tuple(destination):
                return dis
            for dir in dirs:
                newDis, newNode = bfs(node, dir)
                if newDis != 0:
                    heappush(queue, (dis + newDis, tuple(newNode)))
        return -1


